BASE_DIR = os.path.split(__file__)[0]
IMAGE_DIR = BASE_DIR+"/IMAGE_DIR"

UNNAMED_CONSTANT_1 = ","
TEST_URI = r"data:image/jpeg;base64,"
DATA_URI_TEMPLATE = "data:image/png;base64,{data}";#for sake of simplicity all images will be in png
STANDARD_IMAGE_SAVING_FORMAT_NAME_FOR_PILLOW_SAVING = "PNG";
STANDARD_IMAGE_SAVING_FORMAT_NAME_FOR_NAIMG_FILE = "png"
FILE_NAME__FILE_EXTENSION__SEPRATOR_CAHR = "."
BASE64_PADDING_CAHR = "="
BASE64_DEVISEABLE_VALUE = 4;

def form_image_path_from_image_name(image_name):
	return IMAGE_DIR+"/"+F"{image_name}";



def return_time_now_for_file_naming():
	unix_now = time.time();
	as_str = unix_now.__str__(); 
	as_str = as_str.replace(".", "_____")
	return as_str



