def return_file_contetn_as_bytes(image_path):
	with open(image_path, "rb") as f1:
		return f1.read();



def return_data_part_from_data_uri(data_uri:str):
	#NOT FAIL SAFE
	start_of_data_index = data_uri.find(UNNAMED_CONSTANT_1);
	return data_uri[start_of_data_index+1:];

def extract_file_format_from_data_uri(data_uri:str):
	starting_colon_index = data_uri.find(":");
	first_semi_colon_index = data_uri.find(";");
	splited_part_that_shows_mime_type = data_uri[starting_colon_index+1:first_semi_colon_index]
	leading_slash_index = splited_part_that_shows_mime_type.find("/");
	possible_extension_name = splited_part_that_shows_mime_type[leading_slash_index+1:];
	return possible_extension_name;

def convert_base64_string_to_bytestring(data:str)->bytes:
	#NOT FAIL SAFE
	
	return base64.urlsafe_b64decode(data);


def save_this_image_as(content:bytes, file_extension_name:str):
	save_path = form_image_path_from_image_name(return_time_now_for_file_naming())+f".{file_extension_name}"
	with open(save_path, "wb") as f1: 
		f1.write(content)
	return save_path


def remake_this_image_as_png_and_return_new_file_path(image_path):
	image_object = Image.open(image_path);
	new_image_file_path = form_image_path_from_image_name(return_time_now_for_file_naming())+FILE_NAME__FILE_EXTENSION__SEPRATOR_CAHR+STANDARD_IMAGE_SAVING_FORMAT_NAME_FOR_NAIMG_FILE;
	image_object.save(new_image_file_path, STANDARD_IMAGE_SAVING_FORMAT_NAME_FOR_PILLOW_SAVING);
	return new_image_file_path;


def save_image_from_given_data_url_and_return_path_for_saved_image(data_url):
	#NOT FAIL SAFE

	data_as_64b:str = return_data_part_from_data_uri(data_uri=data_url);

	print("A P1",data_as_64b.__len__()%4, data_as_64b[-10:])

	data_as_64b += BASE64_PADDING_CAHR * ((-data_as_64b.__len__())%4)  # to avoid binascii.Error: Incorrect padding

	print("A P2" ,data_as_64b.__len__()%4, data_as_64b[-10:]) 
	
	data_decoded_to_bytes:bytes = convert_base64_string_to_bytestring(data_as_64b)
	
	file_extension_name = extract_file_format_from_data_uri(data_url)
	image_path:str = save_this_image_as(data_decoded_to_bytes, file_extension_name=file_extension_name);
	if file_extension_name != STANDARD_IMAGE_SAVING_FORMAT_NAME_FOR_NAIMG_FILE:
		return remake_this_image_as_png_and_return_new_file_path(image_path=image_path)
	return image_path

