def load_image_from_path_and_convert_into_data_uri(image_path):
	#read_image_content_as_bytes
	image_content_as_bytes = return_file_contetn_as_bytes(image_path);

	




	image_content_as_b64_bytes = base64.urlsafe_b64encode(image_content_as_bytes);

	image_content_as_b64_str = image_content_as_b64_bytes.decode()


	print("B P1" ,image_content_as_b64_str.__len__()%4, image_content_as_b64_str[-10:])

	image_content_as_b64_str += BASE64_PADDING_CAHR * ((-image_content_as_b64_str.__len__())%4)

	as_data_uri:str = DATA_URI_TEMPLATE.format(data=image_content_as_b64_str);

	print("B P2" ,image_content_as_b64_str.__len__()%4, image_content_as_b64_str[-10:])
	return as_data_uri





